import React from 'react';
import './App.css';
import SearchMovies from './SearchMovies'; 
import axios from 'axios';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Movie Search App</h1> 
      </header>
      <main>
        <SearchMovies /> 
      </main>
    </div>
  );
}

export default App;
